import "./css/loginform.css"
function Login() {
    return (
        <>
        <form className = "form" id = "login-form">
        <h3>Đăng Nhập</h3>
            <input name = "username" placeholder = "username" type = "text"></input>
            <input autocomplete="off" name = "password" placeholder = "password" type = "password"></input>
            <input value = "send" type = "submit"></input>
        </form>
        </>
    )
}
function Register() {
    return (
        <form className = "form" id = "register-form">
            <input name = "username" placeholder = "username" type = "text"></input>
            <input name = "password" placeholder = "password" type = "password"></input>
            <input name = "verifiedpassword" placeholder = "verifiedpassword" type = "verifiedpassword"></input>
            <input value = "send" type = "submit"></input>
        </form>
    )
}
function LoginForm() {
    return (
        <div id = "form-container">
        <Login/>
        <Register />
        </ div>
    )
}
export { LoginForm }
